import React, {Component} from 'react';
import Radium from 'radium'

import Parantheses from './parantheses.svg';

const styles = {
  fullStack: {
    height: '100vh',
    width: '100vw',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  contentWrapper: {
    height: '100%',
    width: '100%',
  },
  fullStackContent: {
    marginTop: 0,
    fontSize: 42,
    fontWeight: 300,
    letterSpacing: 1,
    fontFamily: 'brandon-grotesque,Helvetica Neue,Helvetica,Arial',
  },
  fullStackContentSpan: {
    fontWeight: 600,
    marginLeft: 10,
  },
  parantheses: {
    position: 'absolute',
    right: 150,
    width: 200,
  }

}

class MainFullstack extends Component {

  render() { 
    return (
      <section id ="mainFullStack" style={styles.fullStack}>
          <img style={ styles.parantheses} src={Parantheses} alt=""/>
        <div style={styles.contentWrapper}>
          <h2 style={styles.fullStackContent}>FULL-STACK<span style={styles.fullStackContentSpan}>DEV</span></h2>
          <p id="fullStack-content">講一些我會的東東。例如 react, redux等等之類的。啊希望將來可以用英文打比較潮。</p>
        </div>
      </section>
    )
  }
}


export default Radium(MainFullstack)
